function LinkResult(OutputValue) {
    console.log(OutputValue);
    var shortLink = 'Hello World';
    return (
        <div className="result">
            <p>{shortLink}</p>
            <CopyToClipboard text={shortLink} onCopy={ShortenLink()}>
                <button type='button' className='btn'>Copy</button>
            </CopyToClipboard>
        </div>
    )


    function ShortenLink(initalLink) {
        shortLink = 'abc'

    }
}



export default LinkResult
